상속 (Inheritance)
프로토 타입을 이용한 확장
자바스크립트에는 자바와 달리 class 가 존재하지 않아 prototype 을 사용하여 class 를 구현합니다.
상속 Class 생성
Example #1 : JS - ES5
function Shape() {
    this.x = 0;
    this.y = 0;
}

Shape.prototype.move = function (x, y) {
    this.x += x;
    this.y += y;
}

function Rectangle() {
    Shape.call(this);
}

Rectangle.prototype = Object.create(Shape.prototype);
Rectangle.prototype.constructor = Rectangle;

