map
Description
map() 메소드는 배열내의 모든 요소에 대하여 제공된 함수(callback)를 호출하고, 그 결과를 모아서 새로운 배열을 반환 합니다.
Syntax
var newAry = arrayObj.map(function callback(currentValue[, index[, array]]) {
    // newAry 의 새 요소를 반환
}[, thisArg]);

Parameter

callback
새로운 배열 요소를 생성하는 함수


currentValue
배열 요소 중 현재 처리되고 있는 요소


index
