array
map 메소드가 적용되는 본래의 배열


thisArg
callback을 실행할 때 this로 사용되는 값 (기본값은 window 객체)



Example
var numbers = [1, 4, 9];
var roots = numbers.map(Math.sqrt);

console.log(numbers);
// [1, 4, 9]

console.log(roots);
// [1, 2, 3]

var numbers = [1, 4, 9];
var doubles = numbers.map(function (num) {
    return num * 2;
});

console.log(doubles);
// [2, 8, 18]

