Iterator Interface
TC39 에서 정의한 Iterator Interface 정의를 따른 Object 로써 내응은 다음과 같다.
Iterator Interface

next 라는 키를 갖고 있으며 값으로 인자를 받지 않고 Iterator Result Object 를 반환하는 함수가 온다.
Iterator Result Object 는 value 와 done 이라는 키를 갖고 있다.
value 는 실제 값을 의미
done 는 계속 반복 할 수 있는지 따른 boolean 값



