HTTP Transection
요청 처리
서버의 생성
모든 node 웹 서버 어플리케이션은 웹 서버 객체를 만들어야 합니다.이때 createServer 를 이용합니다.
const http = require('http');
const server = http.createServer((request, response) => {
  // Work Process
});

서버로 오는 모든 HTTP 요청 마다 createServer 에 전달된 함수가 한번씩 호출된다.createServer 가 반환한 Server 객체는 EventEmitter 이고 server 객체를 생성하고 리스너를 추가하는 축약 문법이다.

EventEmitter 이란 ?이벤트 모듈의 의해 정의 되며 새로운 이벤트가 추가되거나 삭제될 때 이벤트를 내보냅니다.

const http = require('http');
const server = http.createServer();
server.on('request', (req, res) => {
  // Work Process
});

HTTP 요청이 서버에 오면 node 가 트랜잭션을 다루려고 request 와 response 객체를 전달하며 요청 핸들러 함수를 호출 합니다.
Method, URL, Header 의 처리
요청을 처리할 때, 우선은 Method 와 URL 을 확인한 후 이와 관련된 작업을 실행합니다.node 는 request 객체에 대부분의 프로퍼티를 넣어두므로 꺼내서 사용하면 된다.
const {method, url} = request;

request 객체는 IncomingMessage 의 인스턴스이다.  

IncomingMessage Class 의 특징

HTTP 에 의해 생성된다.
특정 객체의 첫번째 변수로 전달되는 인수 (SERVER http.ClientRequest request event response event)
응답상태 및 헤더, 데이터 등을 액세스 하는데 사용 한다.


헤더 또한 request 객체에서 얻어온다.
const {headers} = request;
const userAgent  = header['user-agent'];


Tips
클라이언트가 설정한 헤더 프로퍼티는 대소문자 구분없이 소문자로만 표현 된다.일부 헤더 정보를 반복해서 설정하면 overwrite 하거나 csv 형태로 구성될 수 있다. 이런 경우에는 rawHeaders 를 사용할 수 있다.

Request Body 의 처리
post 혹은 put 요청시 핸들러에 전달된 request 객체는 ReadableStream 인터페이스를 구현하고 있다.이 스트림에 EventListener 를 등록하거나 다른 스트림의 파이프로 연결 할 수 있다.
각 data 이벤트에서 발생시킨 청크는 Buffer 이며 이는 문자열 데이터이다.이는 end 이벤트에서 이어 붙인 다음에 문자열로 만드는게 가장 좋다.
let body = [];

request.on('data', (chunk) => {
  body.push(chunk);
}).on('end', () => {
  // `body` 에 전체 요청 바디가 문자열로 담겨 있다.
  body = Buffer.concat(body).toString();
});

오류의 관한 처리
request 스트림에서 오류가 발생하면 error 이벤트가 발행하면서 오류를 전달한다.별도의 이벤트 리스너가 등록되어 있지 않다면 오류를 뱉으면서 Node.js 를 종료시킨다.
request.on('error', (error) => {
  console.error(error.stack);
});

HTTP 요청 코드 정리
const http = require('http');

http.createServer((request, response) => {
  const {headers, method, url} = request;

  let body = [];

  request.on('error', (error) => {
    console.error(error.stack);
  }).on('data', (chunk) => {
    body.push(chunk);
  }).on('end', () => {
    body = Buffer.concat(body).toString();

    /**
     *  헤더, 메서드, 요청경로, 바디 등을 가지게 되었으며 
     *  이 요청에 응답하는 작업을 수행할 수 있습니다.
     */
  })
}).listen(8080);


이 코드는 요청 받을 수 있지만 요청한 디바이스(클라이언트) 에 응답 하는 로직이 없기 때문에 타임아웃이 걸릴것 입니다.

응답 처리
응답 상태 코드
별도의 설정이 없으면 HTTP 응답 코드는 200 으로 고정 됩니다.상태 코드를 변경 하려면 statusCode 프로퍼티를 설정해야 합니다.
// 리소스를 찾을수 없음 
response.statusCode = 404;

응답 헤더 설정
setHeader 메서드로 헤더를 설정 한다.
response.setHeader('Content-Type', 'application/json');
response.setHeader('X-Powered-By', 'bacon');


헤더 설정 프로퍼티의 대/소문자는 구분이 없다.

명시적 응답 헤더 데이터 전송
writeHead 메소드를 이용하여 명시적으로 헤더 작성이 가능하다.
response.writeHead(200, {
  'Content-Type': 'application/json',
  'X-Powered-By': 'bacon'
});

응답 바디 전송
response 객체는 WriteableStream 이므로 클라이언트로 보내는 응답 바디는 일반적인 스트림 메서드를 이용하여 작성 합니다.
response.write('');
response.write('');
response.write('Hello, World!');
response.write('');
response.write('');
response.end();

위 코드는 아래와 같이 작성해도 동일하다.
response.end('Hello, World!');

오류에 관한 처리
response 스트림도 error 이벤트를 발생시킬수 있고 때로는 이 오류도 처리해야 합니다.request 스트림에 대한 오류와 동일하게 적용이 가능합니다.
현재까지 적용코드
const http = require('http');

http.createServer((request, response) => {
  const { headers, method, url } = request;
  let body = [];

  request.on('error', (error) => {
    console.error(error);
  }).on('data', (chunk) => {
    body.push(chunk);
  }).on('end', () => {
    body = Buffer.concat(body).toString();

    response.on('error', (error) => {
      console.error(error);
    });

    response.statusCode = 200;
    response.setHeader('Content-Type', 'application/json');

    // 위 두줄의 코드를 한줄로 가능 
    // response.writeHead(200, {'Content-Type': 'application/json'});

    const responseBody = { headers, method, url, body };

    response.write(JSON.stringify(responseBody));
    response.end();

    // 위 두줄의 코드를 한줄로 가능
    // response.end(JSON.stringify(responseBody));

  });
}).listen(8080);

에코 서버 만들기
에코서버란 요청 받은 데이터를 그대로 응답으로 돌려보내는 서버이다.앞에서 했던것 처럼 요청 스트림에서의 데이터를 가져와 응답 스트림에 쓴다.
const http = require('http');

http.createServer((request, response) => {
  let body = [];

  request.on('data', (chunk) => {
    body.push(chunk);
  }).on('end', () => {
    body = Buffer.concat(body).toString();
    response.end(body);
  });
}).listen(8080);

위 코드를 다음 조건에 따라 에코 응답을 보내는것으로 수정한다.

요청 메서드가 POST 인 경우
URL 이 /echo 인 경우

const http = require('http');

http.createServer((request, response) => {
  if (request.method === 'POST' && request.url === '/echo') {
    let body = [];
    request.on('data', (chunk) => {
      body.push(chunk);
    }).on('end', () => {
      body = Buffer.concat(body).toString();
      response.end(body);
    });
  } else {
    response.statusCode = 404;
    response.end();
  }
}).listen(8080);


위의 방법으로 라우팅을 하고 있지만 express 프레임워크나 router 라이브러리릉 통해서 처리도 가능하다.  

request 객체는 ReadableStream 이고 response 객체는 WriteableStream 이므로 pipe 를 사용할 수 있다.
const http = require('http');

http.createServer((request, response) => {
  if (request.method === 'POST' && request.url === '/echo') {
    request.pipe('response');
  } else {
    response.statusCode = 404;
    response.end()
  }
}).listen(8080);

오류에 관한 처리
const http = require('http');

http.createServer(request, response) => {
  request.on('error', (error) => {
    console.error(error);
    response.statusCode = 400;
    response.end();
  });

  response.on('error', (error) =>{
    console.error(error);
  });

  if (request.method === 'POST' && request.url === '/echo') {
    request.pipe(response);
  } else {
    response.statusCode = 404;
    response.end();
  }
}).listen(8080);


HTTP 요청을 다음 동작이 가능하다.  

요청 핸들러로 HTTP 서버의 인스턴스를 생성 가능하고 특정 포트를 열 수 있다.
request 객체에서 Header, Method, URL, Body` 데이터를 가져올 수 있다. 
URL 이나 request 객체의 기반 데이터로 라우팅이 가능하다.
request 객체에서 response 객체로 데이터를 파이프로 연결 가능하다.
request 와 response 스트림 모두에서 스트림 오류 처리가 가능하다.




Reference URL
https://nodejs.org/ko/docs/guides/anatomy-of-an-http-transaction/

Express
Route
라우팅은 요청 URI 및 특정한 HTTP 요청 메소드 (GET, POST, PUT, DELETE) 인 특정 엔드포인트 에 대한 클라이언트 요청에 대해 애플리케이션이 응답하는 방법을 결정 하는것
Syntax
app.METHOD(PATH, HANDLER)

Parameter

app
express 의 인스턴스


METHOD
HTTP 요청 메소드


PATH
서버 경로


HANDLER
라우트가 일치할 때 실행되는 함수



Example
각 요청에 따른 라우트를 정의하고 이에 응답한다.
var express = require('express');
var app = express();

app.get('/', function(req, res) {
  res.send('hello world');
});

Method
대표적인 Express 라우팅 메소드는 다음과 같다.
app.get('/', function (req, res) {
  res.send('Hello World!');
});

app.post('/', function (req, res) {
  res.send('Got a POST request');
});

app.put('/user', function (req, res) {
  res.send('Got a PUT request at /user');
});

app.delete('/user', function (req, res) {
  res.send('Got a DELETE request at /user');
});

Route Chain
app.route() 을 이용하면 라우트 경로에 대한 체이닝 핸들러를 작성 할 수 있다.
app.route('/book')
  .get(function(req, res) {
    res.send('Get a random book');
  })
  .post(function(req, res) {
    res.send('Add a book');
  })
  .put(function(req, res) {
    res.send('Update the book');
  });

all() 메소드를 통해 모든 응답의 대응도 가능.
app.route('/book')
  .all(function(req, res) {
    res.send('Get a random book');
  });

Route Moduler
모듈식 마운팅이 가능한 핸들러의 작성 
var express = require('express');
var router = express.Router();

// middleware that is specific to this router
router.use(function timeLog(req, res, next) {
  console.log('Time: ', Date.now());
  next();
});
// define the home page route
router.get('/', function(req, res) {
  res.send('Birds home page');
});
// define the about route
router.get('/about', function(req, res) {
  res.send('About birds');
});

module.exports = router;

var birds = require('./birds');
...
app.use('/birds', birds);

/birds 및 /birds/about 에 대한 요청을 처리 가능하며 해당 라우트에 대한 특정 미들웨어 함수인 timeLog 를 호출

Express 는 HTTP 메소드에 해당하는 다음과 같은 라우팅 메소드를 지원한다.
get, post, put, head, delete, options, trace, copy, lock, mkcol, move, purge, propfind, proppatch, unlock, report, mkactivity, checkout, merge, m-search, notify, subscribe, unsubscribe, patch, search및 connect.

Path
URI 경로는 문자열 혹은 정규식의 패턴에도 적용된다.
Character Pattern
// acd, abcd
app.get('/ab?cd', function(req, res) {
  res.send('ab?cd');
});

// abcd, abbcd, abbbcd
app.get('/ab+cd', function(req, res) {
  res.send('ab+cd');
});

// abcd, abxcd, abRABDOMcd, ab123cd
app.get('/ab*cd', function(req, res) {
  res.send('ab*cd');
});

// /abe, /abcde
app.get('/ab(cd)?e', function(req, res) {
 res.send('ab(cd)?e');
});

Regular Expression
// a 가 포함된 모든 항목과 일치 
app.get(/a/, function(req, res) {
  res.send('/a/');
});

// butterfly, dragonfly 과는 일치 
// butterflyman, dragonfly man 과는 불일치 
app.get(/.*fly$/, function(req, res) {
  res.send('/.*fly$/');
});

Response
응답 오브젝트에 대한 메소드는 응답을 클라이언트에 전송하고 요청 및 응답의 주기를 종료할 수 있다.라우트 핸들러로부터 다음 메소드중 하나라도 호출되지 않는 경우 클라이언트 요청은 정지된 채로 방치 된다. 



메소드
설명




res.download()
파일이 다운로드되도록 프롬프트합니다.


res.end()
응답 프로세스를 종료합니다.


res.json()
JSON 응답을 전송합니다.


res.jsonp()
JSONP 지원을 통해 JSON 응답을 전송합니다.


res.redirect()
요청의 경로를 재지정합니다.


res.render()
보기 템플리트를 렌더링합니다.


res.send()
다양한 유형의 응답을 전송합니다.


res.sendFile
파일을 옥텟 스트림의 형태로 전송합니다.


res.sendStatus()
응답 상태 코드를 설정한 후 해당 코드를 문자열로 표현한 내용을 응답 본문으로서 전송합니다.



const router = express.Router();

// 클라이언트가 루트 경로로 진입하면 /index 경로로 리다이렉트 시킨다.
router.all('/', (req, res) => {
  res.redirect('/index');
});

// 모든 경로를 index 로 랜더링 한다.
router.all('*', (req, res) => {
  res.render('index');
});

book/03.-back-end/01.-java/01.-general/d.body:
Strategy Design Pattern (전략 디자인 패턴)
디자인 패턴의 가장 중요한 패턴으로 다음 3가지의 요소로 구성된다.
전략객체를 가진 전략 객체
public interface Action {
    void move();
}

전략 객체를 사용하는 컨텍스트 (소비)
public class Walking implements Action {
  @Override
  public void move() {
    System.out.println("Walking road");
  }
}

public class Running implements Action {
  @Override
  public void move() {
    System.out.println("Running road");
  }
}

public class Human {
  void start(Action action) {
    System.out.println("Start Action");
    action.move();
    System.out.println("End Action");
  }
}

전략 객체를 생성해 컨텍스트에 주입하는 클라이언트 (공급)
public class Client {
  public static void main (String[] args) {
    Human human = new Human();

    Walking walk = new Walking();
    human.start(walk);

    Running run = new Running();
    human.start(run);
  }
}

Start Action
Walking road
End Action
Start Action
Running road
End Action


클라이언트가 전략을 생성하여 전략을 실행 (소비) 할 컨텍스트에게 주입하는 패턴이다.

템플릿 메소드 패턴과 유사하지만 다양한 전략을 변경하면서 컨텍스트에게 주입할 수 있다. (템플릿 메소드보다 우수)

Template Method Design Pattern (템플릿 메소드 디자인 패턴)
상위 추상 클래스가 대략적인 로직을 잡아두고 실제로 상세한 구현은 상속을 받아 구현을 강제하도록 하는것
public abstract class Car {
 public void playWithOwner() {
   System.out.println("Start");

   play();

   runSomeThing();
 } 

 abstract void play();

 void runSomething() {
   System.out.println("Something");
 }
}

public class Auto extends Car {
  @Override
  void play() {
    System.out.println("move Car");
  }

  void runSomething() {
    System.out.println("Something others");
  }  
}

public class Main {
  public static void main(String[] args) {
    Car auto = new Auto();

    auto.playWithOwner();
  }
}

Start 
move Car
Something others


