book/03.-back-end/01.-java/01.-general/s.body:
개방 폐쇄의 원칙 (OCP : Open Closed Principle)
SOLID 원칙중에서 2번재 원칙으로 개방폐쇄의 원칙이라 한다.

확장 될것과 불변의 속성을 엄격히 구분한다.두 모듈이 만나는 지점에 인터페이스를 정의한다.구현에 의존하기보다 정의한 인터페이스에 의존하도록 코드를 작성한다.

정의

소프트웨어의 구성요소 (컴포넌트, 클래스, 모듈, 함수) 는 확장에는 열려 있고, 변경에는 닫혀 있어야 한다.

이는 기존의 구성요소는 수정이 일어나지 말아야 하며, 기존의 구성요소를 쉽게 확장하여 재사용 가능 해야 한다는 뜻이며, 프로그램 설계 과정에서 많은 고민이 되어 있어야 하고 이를 위해 자주 사용되는 문법이 interface 를 활용한 방법이다.
아래 예시를 통하여 OCP 의 위배 사항을 살펴 보자
class SoundPlayer {
  void play() {
    System.out.println("play wav");
  }
}
public class Client {
  public static void main(String[] args) {
    SoundPlayer sp = new SoundPlayer();
    sp.play();
  }
}

상기 코드에서 play() 를 다른 파일 포맷의 재생을 원한다면 OCP 원칙에 위배된다.
이러한 경우에는 interface 를 구성하여 OCP 를 만족한다.
interface playAlgorithm {
  public void play();
}

class Wav implements playAlgorithm {
  @Override
  public void play() {
    System.out.println("Play Wav");
  }
}

class Mp3 implements playAlgorithm {
  @Override
  public void play() {
    System.out.println("Play Mp3");
  }
}

위와 같이 재생하고자 하는 playAlgorithm 인터페이스의 play() 를 재정의 하도록 설계한다.
이와 같은 설계 방식을 디자인 패턴에서는 전략 패턴 (Strategy Pattern) 이라고 한다.
OCP 를 만족한 설계는 다음과 같은 장점이 있다.

변경에 유연하게 대처 가능하다.
유지보수 비용이 감소된다.
코드의 가독성이 높아진다.


Reference
https://code.tutsplus.com/tutorials/solid-part-2-the-openclosed-principle--net-36600

리스코프 치환 원칙 (LSP : Liskov Substitution Principle)
SOLID 원칙중에서 3번재 원칙으로 리스코프 치환 원칙 이라고 한다.
OCP (Open Close Principle : 개방 폐쇠의 법칙) 과 밀접한 연관이 있으며 OCP 를 바탕으로 구현한 템플릭 설계의 하나의 예라고 할 수 있다.즉 LSP 는 OCP 의 해결책 중 하나이다.
정의

자식 (파생) 클래스는 언제나 부모 (기반) 타입과 호환이 되어야 한다.
하위 클래스가 상위 클래스의 역할을 대신할 때 논리적으로 맞아 떨어져야 한다.

다음 예는 이를 설명하기 위한 가장 유명한 예 이다.

graph LR
  A["Rectangle"] --> B["Square"]


최초에 기반타입을 담당할 Rectagle 클래스를 선언한다.
여기에는 너비와 높이 등이 선언되어 있으며 도형의 넓이를 반환하는 area 함수까지 구현되어 있다.
class Rectangle {
  private int width;
  private int height;

  public void setHeight(int height) {
    this.height = height;
  }

  public int getHeight() {
    return this.height;
  }

  public void setWidth(int width) {
    this.width = width;
  }

  public int getWidth() {
    return this.width;
  }

  public int area() {
    return this.width * this.height;
  }
}

Rectangle 클래스를 상속 받는 Square 클래스가 있다.
Square 클래스는 정사각형 의 도형 처리를 담당하는 클래스이다.
class Square extends Rectangle {
  @Override
  public void setHeight(int value) {
    this.width = value;
    this.height = value;
  }

  @Override
  public void setWidth(int value) {
    this.width = value;
    this.height = value;
  }
}

위의 두개의 클래스를 소비할 메인 함수이다.
public class MyClass {
  static boolean checkAreaSize(Rectangle r) {
    r.setWidth(5);
    r.setHeight(4);

    if (r.area() != 20 ) {
      throw new RuntimeException("Bad Area");
    }

    return true
  }

  public static void main(String[] args) {
    checkAreaSize(new Rectangle());
    checkAreaSize(new Square()); // Error Exception
  }
}

이를 실행하면 두개의 클래스가 전혀 다른 결과를 가져온다.
하나는 Rectangle 클래스는 넓이가 20 으로 연산 되는데 반해 Square 클래스는 오류를 반환한다.
이것이 바로 리스코프의 치환 원칙 을 벗어난 대표적인 예이다.
다시 정리하면 상위 타입의 객체를 하위타입의 객체로 치환해도 상위 타입을 사용하는 프로그램은 정상적으로 동작 해야 한다.
리스코프 치환을 벗어나는 위반사례는 대표적으로 다음과 같다.

명시된 명세에서 벗어난 값 을 반환한다.
명시된 명세에서 벗어난 오류 를 발생한다.
명시된 명세에서 벗어난 기능 을 수행한다.

해결 방법

상속관계를 제거한다.
문제가 되는 area() 를 Square 로 이동한다.
LSP 를 통하여 자식 클래스가 상속받은 부모 클래스의 역활을 충실히 하면서 확장 해나가야 한다.


Reference
https://code.tutsplus.com/tutorials/solid-part-3-liskov-substitution-interface-segregation-principles--net-36710

book/03.-back-end/01.-java/02.-reference.body:
동기화 (Synchronizred)
Java 에서 동기화 영역은 synchronizred 키워드로 표시된다.  
동기화는 객체에 대한 동기화로 이루어지는데 여러 Thread 가 한 개의 자원을 사용하고자 할 때 해당 Thread 만 제외하고 나머지 Thread 의 접근을 막는 방법이다.블록에 접근을 시도하는 다른 Thread 들은 블록 안의 Thread 가 실행을 마치고 블록을 벗어날때까지 차단 (blocked) 상태 가 된다.
대표적으로 Log Files 과 같이 서로 다른 프로세스에 접근 가능한 리소스를 대상으로 사용할때 효과적이다.

이러한 방식을 배타적 접근 이라고 한다.

장점

thread-safe 하게 사용이 가능하여 사용자의 의도대로 프로그램의 흐름 제어가 가능하다.  

단점

프로그램의 성능저하를 일으킬 수 있다.
Java 내부적으로 메서드나 변수에 동기화를 하기 위해 block & unblock 처리를 하게되는데 이런 처리들을 통하여 소비되는 리소스가 프로그램 전반적인 성능에 영향을 준다.



synchronized 키워드는 다음 네가지 유형의 블록이 쓰인다.
Syntax
인스턴스 메소드에 동기화 적용 (Instance Method)
특정 부분에 대해서만 동기화를 동기화를 할 필요가 있을 경우 아래 메소드와 같이선언문에 있는 synchronized 키워드를 통하여 동기화를 한다.
public synchronized void add(int value) {
  this.count += value;
}

Instance Method 의 동기화는 이 Method 를 가진 Instance (객체) 를 기준 으로 한다.하나의 Class 가 동기화된 Instance Method 를 가지면, 동기화는 이 Class 의 하나의 Instance 를 기준으로 이루어지며 한 시점에 오직 하나의 Thread 만이 동기화된 Instance Method 를 실행할 수 있다.

하나의 Instance 하나의 Thread 이다.

정적 메소드에 동기화 적용 (Static Method)
인스턴스 메소드의 사용법과 같이 선언문에 있는 synchronized 키워드를 통하여 동기화를 한다.
public static synchronized void add(int value) {
  count += value;
}

Static Method 의 동기화는 이 Method 를 가진 Class (객체) 를 기준 으로 한다.JVM 안에 Class 객체는 Class 당 하나만 존재할 수 있으므로, 같은 Class 에 대해서는 오직 한 Thread 에만 동기화된 Static Method 를 실행할 수 있다.

하나의 Class 당 하나의 Thread 이다.

인스턴스 메소드 안에 동기화 적용 (Instance Method Codeblock)
동기화를 메소드 전체에 적용하는것이 아닌 메소드의 특정 부분에 적용하는것이 효율적일 때가 있다.
public void add(int value) {
  synchronized(this) {
    this.count += value;
  }
}

정적 메소드에 안에 동기화 적용 (Static Method Codeblock)
Instance Method Codeblock 과 사용법은 동일하다.
public static void add(int value) {
  synchronized(this) {
    this.count += value;
  }
}


Reference
